import React, {SetStateAction} from "react";

interface Props {
    setOpen : React.Dispatch<SetStateAction<boolean>>;
}
export default function process({setOpen} : Props){
    return(
        <div>
            <div className='flex space-x-6 flex_center mt-4 text-white'>
                <button className='button-color'
                        onClick={(event: React.MouseEvent<HTMLButtonElement>) => setOpen(false)}>닫기
                </button>
                <button className='button-color'>저장</button>
            </div>
        </div>
    )
}
